import React, { Fragment } from "react";
import { NavLink } from "react-router-dom";
import "./Navbar.css";

function Navbar({ user, onLogout }) {
  return (
    <nav className="navbar">
      <ul>
        <li>
          <NavLink to="/home" className={(navData) => (navData.isActive ? "active-style" : "none")}>
            Home
          </NavLink>
        </li>
        <li>
          {user && <button onClick={onLogout}>Logout</button>}
        </li>
        {!user && (
          <Fragment>
            <li>
              <NavLink to="/login" className={(navData) => (navData.isActive ? "active-style" : "none")}>
                Login
              </NavLink>
            </li>
            <li>
              <NavLink
                to="/registration"
                className={(navData) => (navData.isActive ? "active-style" : "none")}
              >
                Registration
              </NavLink>
            </li>
          </Fragment>
        )}
        <li>
          <NavLink to="/configuration" className={(navData) => (navData.isActive ? "active-style" : "none")}>
            Configuration
          </NavLink>
        </li>
      </ul>
    </nav>
  );
}

export default Navbar;
